//SPDX-License-Identifier: UNLICENSED

pragma solidity ^0.8.0;

//Importar SC necesarios
import "../../node_modules/@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "../../node_modules/@openzeppelin/contracts/access/Ownable.sol";
import "../../node_modules/ethereum-datetime/contracts/DateTime.sol";

//Inicializacin del contrato
contract legalContract is ERC721, Ownable, DateTime{

    publicNotary public publicnotary; //Variable que almacena los datos del notario

    //Estructuras de almacenamiento de informacin
    mapping(uint256 => uint256) assetFee; //Guarda el total de cargas para cada activo
    mapping(uint256 => address) tokenSeller; // Guarda el vendedor de cada activo
    mapping(uint256 => mapping(bytes32 => uint256)) tokenCharges; //Guarda la carga mensual de cada activo
    mapping(uint256 => mapping(bytes32 => uint256)) tokenPayments; //Guarda los pagos mensuales de cada activo
    mapping(uint256 => uint256) lastTokenPayment; //Guarda la fecha del ltimo pago realizado para cada activo
    mapping(uint256 => uint256) purchaseDate; //Guarda la fecha de compra de cada activo
    mapping(uint256 => uint256) tokenPrice; //Guarda el precio del activo
    mapping(uint256 => uint256) totalAmountPaid; //Guarda la cantidad acumulada pagada por un token en un determinado momento

    //Declaracin de eventos
    event assetBought(address, uint256);
    event monthlyPay(address, uint256);

    struct publicNotary{ //Objeto del notario 
        string name; //Nombre
        string firstSurname; //Apellidos
        string id; //DNI
        uint256 NotaryID; //Nmero identificador de dicho notario
    }

    constructor(string memory name, 
                string memory firstSurname, 
                string memory id, 
                uint256 NotaryID) 
                ERC721("CollectionName", "CNM"){
        //Guardar la informacin del notario cuando se crea el contrato
        publicnotary = publicNotary(name, firstSurname, id, NotaryID);
    }

    //Funcin para mintear el token, solo ejecutable por el propietario del contrato, es decir, aquel que lo despliega en al blockchain
    function mintToken(uint256 tokenId, uint256 price) public onlyOwner {
        tokenPrice[tokenId] = price * 10**18; //Guardar el precio del token en ethers
        _mint(msg.sender, tokenId); //El propietario del contrato mintea el token y por el momento este token es de su propiedad
    }

    //Funcin para comprar un activo, puede ser ejecutada por cualquier usuario
    function buyAsset(uint256 tokenId) public payable {
        require(assetFee[tokenId] == 0, "Este activo no esta libre de cargas"); //Si el activo tiene cargas no podr transferirse

        uint256 entranceFee = (tokenPrice[tokenId] * 10/100) * 10**18; //Calcular el 10% del valor del activo para usarlo como entrada
        require(msg.value == entranceFee, "El precio de entrada no es correcto"); //Precio simblico del activo
        
        address tokenOwner = ownerOf(tokenId); // Guardar el propietario del activo
        
        tokenSeller[tokenId] = tokenOwner; //Guardar el vendedor del activo
        purchaseDate[tokenId] = block.timestamp; //Guardar la fecha en la que se vende el activo
        totalAmountPaid[tokenId] += entranceFee; //Sumar el precio de la entrada al total pagado por el activo
        payEntranceFee(tokenOwner, msg.value); //Ejecutar la funcin del pago de la entrada
        _safeTransfer(tokenOwner, msg.sender, tokenId, ""); //Ejecutar la transferencia del activo
        
        emit assetBought(msg.sender, tokenId); //Informar a la red de que el usuario que ejecuta esta funcin ha adquirido un determinado activo
    }

    //Funcin para abonar la entrada del activo. Que sea privada nos asegura que la funcin se ejecutar solo si es llamada desde el mismo contrato
    function payEntranceFee(address tokenOwner, uint256 price) private {
        payable(tokenOwner).transfer(price); //Al propietario del token se le transfiere la cantidad "price"
    }

    //Funcin para proceder con el pago mensual del activo. Cualquiera puede ejecutarla
    function monthlyPayment(uint256 tokenId) public payable{
        require(msg.sender == ownerOf(tokenId), "No eres el propietario de este token"); //Comprobar que quien ejecuta la funcin es propietario del token que quiere pagar
        require(totalAmountPaid[tokenId] < tokenPrice[tokenId]); //Comprobar que no se haya pagado an totalmente el activo

        uint256 monthlyPrice = (tokenPrice[tokenId]*5/100) * 10**18;//Calcular el pago mensual del activo (5% del total)

        require(msg.value == monthlyPrice, "La cantidad abonada no es correcta"); //Comprobar que el pago es de 0.05 ehters

        address seller = tokenSeller[tokenId]; //Obtener el vendedor del contrato
        bytes32 date; //Crear una variable fecha en formato hash
      
        date = keccak256(abi.encodePacked(getYear(block.timestamp), getMonth(block.timestamp))); //La fecha guarda el mes y el ao actuales en formato hash

        require(tokenPayments[tokenId][date] == 0, "El pago de este mes ya se ha efectuado"); //Comprobar si el pago del mes actual se ha efectuado

        lastTokenPayment[tokenId] = block.timestamp; //Guardar la fecha del ltimo pago
        tokenPayments[tokenId][date] = monthlyPrice; //Guardar el pago mensual
        totalAmountPaid[tokenId] += monthlyPrice; //Acumular el pago mensual
        payable(seller).transfer(msg.value); //Transferir el pago mensual a la cuenta del vendedor

        emit monthlyPay(msg.sender, tokenId); //Se ifnorma a la red de que quien ejecuta esta funcin ha pagado mensualmente por su token
    }

    //Funcin para pagar los retrasos. Cualquiera puede ejecutar esta funcin
    function payCharge(uint256 tokenId, uint16 year, uint8 month) public payable {
        bytes32 date = keccak256(abi.encodePacked(year, month)); //Hashear el ao y el mes
        uint256 monthlyPrice = (tokenPrice[tokenId]*5/100) * 10**18;//Calcular el pago mensual del activo (5% del total)

        require(msg.sender == ownerOf(tokenId),"No eres el propietario de este token"); //Comprobar que quien ejecuta la accin va a pagar por un token del cual es propietario
        require(totalAmountPaid[tokenId] < tokenPrice[tokenId]); //Comprobar que no se haya pagado an totalmente el activo
        require(tokenCharges[tokenId][date] > 0, "Este mes no tiene cargas"); //Comprobar que el mes tiene una carga
        require(msg.value == monthlyPrice, "El pago debe ser del 5% del total del activo"); //Comprobar que el valor abonado es el correcto

        address seller = tokenSeller[tokenId]; //Obtener el vendedor del activo

        tokenCharges[tokenId][date] = 0; //Eliminar la carga del mes que se ha abonado
        tokenPayments[tokenId][date] = monthlyPrice; //Aadir el pago a los meses pagados
        assetFee[tokenId] -= monthlyPrice; //Restar el total abonado de la cantidad total de cargas
        payable(seller).transfer(msg.value); //Enviar el dinero al vendedor
    }

    //Funcin para aadir un retraso en un pago. La funcin la puede ejecutar nicamente el propietario del contrato
    function addCharge(uint256 tokenId, uint256 amount, uint16 year, uint8 month) public onlyOwner { 

        bytes32 date = keccak256(abi.encodePacked(year, month));//Hashear el ao y el mes
        require(tokenPayments[tokenId][date] == 0, "Este pago ya ha sido efectuado previamente"); //Comprobar que el pago de dicho mes/ao no se ha efectuado
       
        //Evitar aadir un retraso en una fecha futura
        require(month < getMonth(block.timestamp) && year <= getYear(block.timestamp), "No se pueden introducir cargas para fechas futuras o para el mes actual"); 
       
        uint16 yearAdquired = getYear(purchaseDate[tokenId]); //Obtener el ao en el que se compr el activo
        uint8 monthAdquired = getMonth(purchaseDate[tokenId]); //Obtener el mes en el que se compr el activo

        //Evitar aadir cargas en meses en el que el activo an no se haba comprado
        require(yearAdquired > year || yearAdquired == year && monthAdquired < month, "No se pueden introducir cargas para fechas anteriores a la compra del activo"); 

        assetFee[tokenId] += amount; //Sumar la carga actual al total de cargas
        tokenCharges[tokenId][date] += amount; //Aadir la carga al mes en concreto que no se ha abonado
    }

    //Funcion para embargar tokens. Funcin nicamente ejecutable por el propietario del contrato
    function seizeAsset(uint256 tokenId) public onlyOwner {
        require(assetFee[tokenId] >= 0.25 ether, "Este activo no tiene mas de 0.25 ethers de deuda"); //Comprobar que se deban ms de 0.25 tokens
        address tokenOwner = ownerOf(tokenId); //Obtener el propietario actual del activo

        _safeTransfer(tokenOwner, msg.sender, tokenId, ""); //Transferir ese activo al propietario del contrato
    }

    // Funcin para obtener las cargas de un activo
    function getPayment(uint256 tokenId, uint16 year, uint8 month) public view returns(uint256){
        bytes32 date = keccak256(abi.encodePacked(year, month)); //Hashear el mes y el ao que queremos comprobar
        return tokenPayments[tokenId][date]; //Devolver el total de carga para un token en un mes y ao en concreto
    }
}

